class Solution(object):
    def shortestBeautifulSubstring(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: str
        """
        min_len = float('inf')
        min_sub = ""
        for i in range(len(s)):
            ones_count = 0
            for j in range(i, len(s)):
                if s[j] == '1':
                    ones_count += 1
                if ones_count == k:
                    if j - i + 1 < min_len:
                        min_len = j - i + 1
                        min_sub = s[i:j+1]
                    elif j - i + 1 == min_len:
                        min_sub = min(min_sub, s[i:j+1])
                    break
        return min_sub
